import AvatarNadia from "../../Assets/avatarNadia.jpg"
import AvatarJose from "../../Assets/avatarJose.jpg"
import AvatarViviane from "../../Assets/avatarViviane.png"



export const PROFILES = [
    {
        avatar: AvatarNadia,
        name: "Nadia Benitez",
        tratamento: "Prótese Dentária",
        comentario: '"Eu amei conhecer a clínica. Finalmente uma clínica que oferece tratamentos de qualidade de forma acessível. Eu e minha família recomendamos. Minha sogra já está em tratamento de implantes também"'
    },
    {
        avatar: AvatarJose,
        name: "José Fagundes",
        tratamento: "Implante Dentário",
        comentario: '"Vivo com mais qualidade de vida. Não preciso me preocupar pra comer qualquer coisa. Estou mais seguro e feliz. Recomendo sim. Clínica boa, dentista muito profissional e preço justo"'
    },
    {
        avatar: AvatarViviane,
        name: "Viviane Souza",
        tratamento: "Ortodontia",
        comentario: '"Me incomodava bastante ter os dentes tortos. Estava procurando uma clínica que fosse perto de casa e vim até aqui. Percebi que não precisava mais procurar. Posso fazer todo o meu tratamento em um só lugar"'
    },
]
